import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { solid, regular, brands } from '@fortawesome/fontawesome-svg-core/import.macro'
const caretStyle = {
    marginLeft: '5px',
}
const cName = 'menu-item';
const menuItems = [
    {
        name: 'Today',
        path: '/',
        cName,
        dropdown: [<FontAwesomeIcon icon={solid('caret-right')}/>, <FontAwesomeIcon icon={solid('caret-right')}/>]
    },
    {
        name: 'Calandar',
        path: '/',
        cName
    },
    {
        name: 'Projects',
        path: '/',
        cName, 
        dropdown: [<FontAwesomeIcon icon={solid('caret-right')}/>, <FontAwesomeIcon icon={solid('caret-right')}/>]
    },
    {
        name: 'Uncatgorized',
        path: '/',
        cName,
        dropdown: [<FontAwesomeIcon icon={solid('caret-right')}/>, <FontAwesomeIcon icon={solid('caret-right')}/>]
    },
    {
        name: 'Tags',
        path: '/',
        cName,
        dropdown: [<FontAwesomeIcon icon={solid('caret-right')}/>, <FontAwesomeIcon icon={solid('caret-right')}/>]
    },
    {
        name: 'Notebook',
        path: '/',
        cName
    },
]

export default menuItems;
